import React, { useState, useEffect } from 'react';
import { Link, NavLink  } from "react-router-dom";
import Login from'../comp/Login';
import Navbarinside from '../comp/Navbarinside';



import axios from "axios";

function AvailableDonors() {
  const [donors, setDonors] = useState([]);
  const [filteredDonors, setFilteredDonors] = useState([]);

  useEffect(() => {
    async function fetchData() {
      const result = await axios.get("/api/donors");
      setDonors(result.data);
      setFilteredDonors(result.data);
    }
    fetchData();
  }, []);

  function handleFilterChange(event) {
    const filterValue = event.target.value.toLowerCase();
    const filtered = donors.filter(donor => {
      return (
        donor.name.toLowerCase().includes(filterValue) ||
        donor.bloodType.toLowerCase().includes(filterValue)
      );
    });
    setFilteredDonors(filtered);
  }

  return (
    <div>
      <h2>Available Donors</h2>
      <input type="text" placeholder="Search donors" onChange={handleFilterChange} />
      <ul>
        {filteredDonors.map(donor => (
          <li key={donor.id}>{donor.name} ({donor.bloodType})</li>
        ))}
      </ul>
    </div>
  );
}

const Pagelogin = () => {
  return (
    <>
    < Navbarinside/>
    <Login />
    </>
  );
}

export default Pagelogin;
